INSERT INTO `anuncios` VALUES (3,2,5,'Vendo Ford Focus','Bom dia \n Vendo Ford Focus - Estacionado com 3 portas.','911111111','','2022-05-01 22:11:59','2022-04-04 16:56:31','2022-05-01 22:13:52',NULL),(6,6,5,'T2 OPEN SPACE','T2 - openspace -completamente renovado\n\n2 quartos\ncozinha + sala (openspace)\nwc renovado - com base de duche\ncozinha equipada e completamente nova\nc/elevador\nc/ lugar de garagem\nc/lareira na sala\n\n-5 min a pé do hospital São João (polo de Valongo)\n-supermercados (pingo doce e mercadona) nas proximidades\n-comercio na zona\n10 min do cruzamento do alto da maia e da areosa\nautoestradas na proximidade (bons acessos)','912222222','','2022-05-01 22:12:59','2022-05-01 21:36:19','2022-05-01 22:13:52',NULL),(7,6,5,'ANDAR MORADIA - T3','ALUGA-SE\nANDAR MORADIA - T3\nPróximo Hosp. S. João\nExige-se fiador ou caução\nRenda acessível','922222222','','2022-05-01 22:13:03','2022-05-01 21:36:19','2022-05-01 22:13:52',NULL),(9,7,5,'MESTRE SOARÉ','MESTRE SOARÉ\nPAGAMENTO DEPOIS DO RESULTADO\nVidente médium curandeiro, grande espiritualista em problemas de amor, negócios, aproximar, afastar, aconselhamento para problemas de mau olhado.Não há problema s/ solução. Pessoalmente ou à distancia. Ermesinde','931234565','',NULL,'2022-05-01 21:39:24','2022-05-01 21:49:02',NULL),(10,7,5,'Gabinete de Contabilidade','CONTAS VERDADEIRAS – GABINETE DE CONTABILIDADE\nPara tratar da sua contabilidade empresarial e particular.',NULL,NULL,NULL,'2022-05-01 21:39:24','2022-05-01 21:39:24',NULL),(11,8,5,'GEFORCE RTX 3090','Vários modelos de placas gráficas disponíveis em estoque, como:\n\nGEFORCE RTX 3090\nRTX 3080 Ti\nRTX 3080\nRTX 3070 Ti\nRTX 3070\nRTX 3060 Ti\nRTX 3060\nRADEON RX 6900 XT\nRadeon RX 6800 XT\nRadeon RX 6700 XT\nRadeon RX 5700 XT\n\nAs placas gráficas estão disponíveis em diferentes fabricantes, como Msi, Asus, Zotac, Evga, gigabyte e outros.\n\nNós apenas vendemos novas placas gráficas e originais.\n',NULL,NULL,NULL,'2022-05-01 21:40:13','2022-05-01 21:40:13',NULL),(12,8,5,'Macbook PRO i9','qui vem o macbook mais rápido de todos os tempos .. é novo e vem com acessórios completos, todos selados dentro da caixa.\n\nretina display, sons poderosos, e muita bateria e também vem com teclados melhorados borboleta.\n\nEspecificações: -\n\n15 \"tela Retina True Tone\n2.9GHz Six-core 8ª Geração i9\nTurbo Boost para 4.8Ghz\nSSD 4TB baseado em PCIe\nRadeon Pro Vega 20 4GB HBM2\n4x Thunderbolt 3 Portas\nMemória de 32 GB 2400MHz\nBarra de toque e ID de toque\n\noferta promocional\ncompre mais e consiga bons descontos ..!','12343421','',NULL,'2022-05-01 21:41:09','2022-05-01 21:41:09',NULL),(13,10,5,'Serviço de Corte de Chapa','SERVIÇO DE CORTE DE CHAPA\nPLASMA DE ALTA DEFINIÇÃO ATÉ 30 mm\nOXICORTE ATÉ 120 mm\nDIMENSÕES ATÉ 6000 x 2500 mm\nEQUIPAMENTO DE ÚLTIMA GERAÇÃO\nLOCALIZAÇÃO: PERAFITA, JUNTO À A28','11111111','chapa@chapa.pt',NULL,'2022-02-25 00:00:00','2022-02-25 00:00:00',NULL),(14,12,5,'CARPINTEIRO Polivalente Oficial 1ª','Empresa de construção civil\nprocura:\nCARPINTEIRO\nPolivalente Oficial 1ª\nLocal: Bélgica\nOferecemos excelentes condições de trabalho','919191919',NULL,NULL,'2022-04-01 00:00:00','2022-04-01 00:00:00',NULL);
