INSERT INTO `noticias` VALUES (1,1,1,'Amnistia Internacional pede investigação a munícipios que acolhem refugiados ucranianos','A Amnistia Internacional defendeu, este sábado, a realização de um inquérito a todos os municípios envolvidos no acolhimento de refugiados ucranianos que fogem à invasão Russa. A organização não-governamental (ONG) acredita que o que caso de Setúbal não é único e insta o Governo e o Alto Comissariando para as Migrações a abrir um inquérito para apurar responsabilidades.','O alerta da ONG vem no seguimento da notícia do Expresso, que dá conta de refugiados ucranianos que foram recebidos por cidadãos russos residentes em Portugal com posições próximas da Rússia. Pedro Neto, diretor executivo da Amnistia Internacional, acredita que o que sucedeu em Setúbal pode estar a acontecer em mais autarquias, e alerta para a facilidade da \"inteligência russa [em] imiscuir-se nos trabalhos da administração pública\", disse em declarações à RTP.','P',1,4,'2022-04-01 00:00:00','2020-04-01 00:00:00',NULL),(2,1,1,'Quase todas as taxas moderadoras acabam em junho e outras notícias em 60 segundos','','','P',0,NULL,'2022-04-01 00:00:00','2022-05-01 22:36:17',NULL);
/*!40000 ALTER TABLE `noticias` ENABLE KEYS */;
UNLOCK TABLES;

